import React from 'react';
import './NavTab.css';

function Navtab() {
  return (
    <div className='navtab'>
      <p className="navtab__title">О проекте</p>
      <div className="navtab__line"></div>
      <div className="navtab__blocks">
        <div className="navtab__block">
          <p className="navtab__block-title">Дипломный проект включал 5 этапов</p>
          <p className="navtab__block-subtitle">Составление плана, работу над бэкендом, вёрстку, добавление функциональности и финальные доработки.</p>
        </div>
        <div className="navtab__block">
          <p className="navtab__block-title">На выполнение диплома ушло 5 недель</p>
          <p className="navtab__block-subtitle">.</p>
        </div>
      </div>
    </div>
  )
}
export default Navtab;
